import { useNavigate } from 'react-router-dom';
import RoundedButton from './RoundedButton';
import './BackButton.css';

function BackButton() {
  const navigate = useNavigate();

  return (
    <div className="back-button-container">
      <RoundedButton
        onClick={() => navigate(-1)}
        color="var(--secondary)"
        textColor="var(--text)"
      >
        ‚Üê Back
      </RoundedButton>
    </div>
  );
}

export default BackButton;
